    false,nt"url": null,nt"notes": "This narrative report for Mud Lake National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1946.
    The report begins by summarizing the weather conditions, water conditions, and food
    and cover during this period. Wildlife- including migratory birds, upland game birds,
    big game animals, fur animals, predators, and rodents- is also covered. The Refuge
    development and maintenance section discusses physical developments and plantings.
    Resource management is outlined; topics include grazing, haying, and fur harvesting.
    The public relations section discusses Refuge visitors and violations. N-R forms
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
